import React from "react";
import SocialItem from "./SocialItem";

function Social() {
  return (
    <ul className="list-group">
      <SocialItem
        media="Facebook"
        id="facebook"
        img="https://picsum.photos/200"
      />
      <SocialItem
        media="Youtube"
        id="youtube"
        img="https://picsum.photos/200"
      />
      <SocialItem
        media="Instgram"
        id="instagram"
        img="https://picsum.photos/200"
      />
    </ul>
  );
}
export default Social;
